import React from 'react'
import {View, Image,StylesSheet} from 'react-native';
const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 50,
    zIndex: 100,
    flexDirection: 'row',
    justifyContent: 'space-between',
    width: '100%',
    paddingHorizontal: 20,
  },
  logo: {
    width: 100,
    height: 20,
    resizeMode: 'contain',
  },
  menu: {
    width: 25,
    height: 25,
    resizeMode: 'contain',
  }
});
const Header = () => {
    return (
        <View style={styles.container}>
            {/* <Image style={} source={} />
            <Image style={} source={} /> */}
        </View>
    )
}

export default Header;
